import React from "react";
import styled from 'styled-components';
import Number from "./number";
const Wheel = () => {
    
    let Container = styled.div `
    max-width: 1200px;
    height: 100px;
    border: solid black 1px;
    box-sizing: border-box;
    `
    return (
        <Container>
            <Number></Number>
        </Container>
    )
}

export default Wheel;
